import React, {Component} from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import {
    Container, Col, Form,
    FormGroup, Label, Input,
    Button,
} from 'reactstrap';

class App extends Component {


    render() {
        return (
            <div className="App justify-content-center col-md-3 border border-info mt-lg-5 py-5">
                <h2>Sign In</h2>
                <form className="form">
                    <div>
                        <div>
                            <label>Email</label>
                            <input
                                type="text"
                                name="username"
                                id="exampleEmail"
                                placeholder="Type your username"
                            />
                        </div>
                    </div>
                    <div>
                        <div>
                            <label for="examplePassword">Password</label>
                            <input
                                type="password"
                                name="password"
                                id="examplePassword"
                                placeholder="********"
                            />
                        </div>
                    </div>
                    <button>Submit</button>
                </form>
            </div>
        );
    }
}

export default App;
